import React from 'react';
import HeroSection from '../components/HeroSection';
import SearchSection from '../components/SearchSection';
import FutureSection from '../components/FutureSection';

const Home = () => {
  return (
    <div className="font-sans">
      <HeroSection />
      <SearchSection />
      <FutureSection />
    </div>
  );
};

export default Home;
